import React,
      { Component } from 'react';
import { Link } from 'react-router-dom'

class Footer extends Component {

  constructor( props )
  {

    super();

  }

  processLinks( arr_links )
  {

    return arr_links.map( ( link ) => {
      return (
        <Link to={link.link}>
          <link>{link.title}</link>
        </Link>
      );
    });

  }

  processCollums( arr_collums )
  {

    return arr_collums.map( ( collum ) => {

      return (
        <div data-container-collum>
          <div data-title>{collum.title}</div>
          <ul>
            {this.processLinks( collum.links )}
          </ul>
        </div>
      );

    });

  }

  render() {

    let { footer_texts } = this.props;

    return (
      <div data-component="footer" className="">

          <div className="container-page hidden">

            <div data-container-logo>

              <i data-logo>
                <i className="icon-coins"></i>
                <p>
                  Oliveira
                  <span>Capital</span>
                </p>
              </i>

            </div>

            <div data-container-collums>

              { this.processCollums( footer_texts.collums ) }

              <div data-container-collum>
                <div data-title>Servicos</div>
                <ul>
                  <li>Servicos & Diferenciais</li>
                  <li>Modelo Monetizacao</li>
                  <li>Seguranca & Privacidade</li>
                </ul>
              </div>

              <div data-container-collum>
                <div data-title>A Empresa</div>
                <ul>
                  <li>Sobre</li>
                  <li>Nossa Historia</li>
                  <li>Missao</li>
                </ul>
              </div>

              <div data-container-collum>
                <div data-title>Canais</div>
                <ul>
                  <li>Fale Conosco</li>
                  <li>Carreiras</li>
                  <li>F.A.Q</li>
                </ul>
              </div>

            </div>

          </div>

          <div data-copy>

            <div className="container-page hidden">

              <p>&copy; Todos os Direitos Reservados - 2019</p>

              <ul>
                <li>Termos de Uso</li>
                <li>Termos de Privacidade</li>
              </ul>

            </div>

          </div>

      </div>
    );
  }
}
export default Footer;
